			<p><P> November 28, 1989, Tuesday, Home Edition  </P> <P> EARNINGS  </P> <P> PacifiCare Health Systems Inc.: The Cypress health maintenance organization  said earnings for fiscal 1989 rose 71% to $10.9 million. Revenue was up 52% to  $650.2 million. The company credited improved results to ongoing cost-control  efforts.  </P></p>
